script:
if (! this.button) {
    this.button='default';
    this.getButton('save').setColor('green');
}

var layers={
    'default': {
        layer:'Default layer',
        info:'<h3>General overview of the sample</h3> Click on a button to change specific values'
        },
    'physical': {
        layer:'Physical',
        info:'<h3>Physical characteristics</h3> Enter here simple values like bp, mp, ...'
    },
    'admin': {
        layer:'Admin',
        info:'Admin'
    },
    'spectra': {
        layer:'Spectra',
        info:'<h3>Spectra</h3> '
    },
    'images': {
        layer:'Images',
        info:'<h3>Images</h3>'

    },
    'molecule': {
        layer:'Molecule',
        info:'<h3>Molecule</h3>Information concernifng an organic molecule.'
    },
    'bioproduct': {
        layer:'Bioproduct',
        info:'<h3>Bioproducts</h3>Currently designed more for peptide and proteine sequence'
    }
}

if (layers[this.button]) {
    for (var key of Object.keys(layers)) {
        this.enableButton(key);
    }
    API.switchToLayer(layers[this.button].layer, {autoSize: true, onlyLarger:true});
    this.disableButton(this.button);
    API.createData('layerInfo',layers[this.button].info);
} else {
    switch (this.button) {
        case 'save':
            API.doAction('save');
            break;
        case 'help':
            API.doAction('Help');
            break;
    }
}

var action=getAction() || {name:''};
var sample=API.cache('sample');
console.log("Receive action: ",action);
if (!sample) return;

if(this.action) {
    switch (action.name) {
    default:
        sample.handleAction(action);
    }    
} else if(this.variable) {
    sample.handleDrop(this.variable, true);
}

filterRow:
if (this.event=='newRow') {
    var emptyRow={
        value:undefined,language:'en'
    };
    for (var key of Object.keys(emptyRow)) {
        if (! this.row.item[key]) {
            this.row.item[key]=emptyRow[key];
        }
    }
}

script:
var html=this.action.value.report;

UI.dialog(html, {
    title:'Report of analysis'
});

if(this.event === 'renderAction' && this.column.id === 'r') {
    if(this.row.item.report) {
        this.renderOptions.disabled = false;
    } else {
        this.renderOptions.disabled = true;
    }
}

require(["file-saver"],function(fileSaver) {
    var spectrum=API.getData("molfile").get();
    var blob = new Blob([spectrum+""], {type: "chemical/x-mdl-molfile;charset=utf-8"});
    fileSaver( blob, "structure.mol");    
})

